import React from 'react';
import './AboutPage.css';

function AboutPage() {
  return (
    <div className="about-page">
      <div className="about-container">
        <h1>About OLX</h1>
        <p>
          OLX is the world's leading classifieds platform, providing local communities in high-growth markets with vibrant online marketplaces. We connect people to buy, sell or exchange used goods and services, making it fast and easy for anyone to post a listing through their mobile phone or on the web.
        </p>
        <p>
          Every month, hundreds of millions of people in local markets around the world use OLX's online marketplace to find and sell a wide range of products, including computers, cell phones, furniture, sporting goods, cars and real estate.
        </p>
        <h2>Our Mission</h2>
        <p>
          Our mission is to empower people to upgrade their lives by making it easy and safe to buy and sell through our platform. We are committed to building a trusted community where users can connect with one another to find great value and unique items.
        </p>
      </div>
    </div>
  );
}

export default AboutPage;
